import React from 'react';
import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';

const Login = (props) => {
    return (
        <div>
            <Modal isOpen='true'>
                <ModalHeader>
                    <Button color='primary'>Login</Button>
                </ModalHeader>
            </Modal>
        </div>
    );
}

export default Login;
